function CampoTextoEjemplo(propiedades) {
    return(
        <div className="campo-texto">
                    <label for="{propiedades.titulo}" class="label">{propiedades.titulo}</label>
                    <input type="text" id="{propiedades.titulo}" placeholder="Teff" class="input input-name"/>
        </div>
    )
}
